css:
@-moz-document url-prefix("https://inbox.google.com/")
{
	html { filter: invert(80%)contrast(120%); background-color: #121212; font-smoothing: antialiased; }
    img { filter: invert(100%); }
    nav img { filter: invert(0%); }
    *::before { box-shadow: none }
    #gb#gb a.gb_b { filter: invert(100%); }
    #GH { filter: invert(100%); }
    .ux.JuVnOb { filter: invert(100%); }
    .actionIcon { filter: invert(100%); }
    .F { filter: invert(0%); }
    button > img { filter: invert(0%); }
    .m .r>.jJ, .M .r>.jJ { filter: invert(100%); }
    .m .r, .M .r { filter: invert(100%); }
}
